import React from "react";
import Search from "./components/navbar/Search";
import Main from "./components/main";
import { Card } from "@nextui-org/react";
// import "./styles.css";

export default function App() {

  const back={
    backgroundImage: "url('https://columbiametro.com/wp-content/uploads/2018/10/background3.jpg')",
    justifyContent: "center",
    alignItems: "center",
    margin: "auto"
  }

  return (
    <div>
      <Search />
      <Card
        css={{ width: "70%", marginLeft: "15%", marginTop: "1%", }}
        style={{back}}
      >
        <Card.Body>
          <Main />
        </Card.Body>
      </Card>
    </div>
  );
}
